I have many different calibers of brass for sale or trade. Some brass has been completed processed (cleaned, deprimed, swagged, full length re-sized & trimmed to spec) and is ready to load. I have a lot of brass that I am still sorting through and cleaning and I will keep updating calibers available. If you are looking for something specific contact me and I will see if I have it. Pricing is as follows:
Fully processed .223 / 5.56mm;
$15/100, $35/250, $65/500
Fully processed 300 AAC Blackout (converted from .223/5.56mm brass. 300 AAC factory head stamps also available additional cost);
$18/100, $40/250, $75/500
Fully processed .40 S&W;
$7/100, $15/250, $27/500

Non-processed brass:
.45 ACP;
$5/100, $12/250, $20/500
9mm;
$3.50/100, $8/250, $14/500
Also have some .38 special, .357 mag, 44 mag, 44 special, 45 long colt available. 
Also have some .308, 30-06, 7.62x39, 7mm rem mag and others available. 
Non processed brass is tumbled and is mixed head stamps and most 1x fired mixed with some reloads. I include a few extra cases with each purchase (even fully processed batches) in case I miss a damaged piece of brass. Text or email with questions or to arrange meeting. Located in Kalispell. REDACTED.
